level1.input_text_Python:
class Mob:
    def __init__(self, x, y):
        self.x = x
        self.y = y
    def go_up(self, n):
        self.y += n
    def go_down(self, n):
        self.y -= n
    def go_right(self, n):
        self.x += n
    def go_left(self, n):
        self.x -= n

mob = Mob(0, 0)

level1.input_text_C:
#include <stdio.h>
struct Mob {
    int x;
    int y;
};
void go_up(struct Mob *mob, int n) {
    mob->y += n;
}
void go_down(struct Mob *mob, int n) {
    mob->y -= n;
}
void go_right(struct Mob *mob, int n) {
    mob->x += n;
}
void go_left(struct Mob *mob, int n) {
    mob->x -= n;
}
int main() {
    struct Mob mob = {0, 0};

    return 0;
}

level1.input_text_C++:
#include <iostream>
#include <string>
using namespace std;
class Mob {
    public:
        int x;
        int y;
        Mob(int a, int b) {
            x = a;
